pragma solidity 0.5.8;

contract Election {
    // Model a Driver
    string public Driver1;

    struct Driver {
        uint id;
        string name;
        uint lat;
        uint long; //ufixed long
    }

    // Store accounts that have voted
    // mapping(address => bool) public voters;
    // Store drivers
    // Fetch Driver
    mapping(uint => Driver) public drivers;
    // Store drivers Count
    uint public driversCount;

    // voted event
    event votedEvent (
        uint indexed _DriverId
    );

    constructor() public
    {
        Driver1 = "Awesome";
        addDriver("Driver 1");
        addDriver("Driver 2");
        addDriver("Driver 3");
        addDriver("Driver 4");
        addDriver("Driver 5");
        addDriver("Driver 6");
    }

    function addDriver (string memory _name) private {
        driversCount ++;
        drivers[driversCount] = Driver(driversCount, _name, 0, 0);
    }

    function vote (uint _DriverId, uint lat, uint long) public {
        // require that they haven't voted before
        // require(!voters[msg.sender]);

        // require a valid Driver
        require(_DriverId > 0 && _DriverId <= driversCount);

        // record that voter has voted
        // voters[msg.sender] = true;

        // update Driver vote Count
        drivers[_DriverId].lat = lat;
        drivers[_DriverId].long = long;

        // trigger voted event
        emit votedEvent(_DriverId);
    }
}
